Nature Documentary hosted by Alvin Chea, published by Illustra Media in 2011 - English narration


Information
------------------------------

Metamorphosis: The Beauty &amp; Design of Butterflies
Throughout history butterflies have fascinated artists and philosophers, scientists and school children with their profound mystery and beauty. In Metamorphosis you will explore their remarkable world as few ever have before. Spectacular photography, computer animation and magnetic resonance imaging open once hidden doors to every stage of a butterfly's life-cycle. From an egg the size of a pinhead.to a magnificent flying insect. It is a transformation so incredible biologists have called it &quot;butterfly magic.&quot;
Filmed in the rain forests of Ecuador, Mexico's Trans-Volcanic mountain range, and leading research centers, Metamorphosis is an unforgettable documentary filled with the joys of discovery and wonder.

